import { useDispatch, useSelector } from "react-redux";
import myStore, { actions }                  from "../Store/Store";

export default function useStore(ste? :string[]){
    let dispatch = useDispatch()
    let store  = useSelector<IStore,IStore>(store=>{
        if(!ste)
             return store;
      
        let obj:IStore = {} 
        ste.forEach((key,i)=>{
            obj[key] = store[key]
        })


        return obj;
    })
    return { store, dispatch ,actions}
}
